import React from 'react';
import 'pages/Dashboard.css';

function Dashboard() {
  return (
    <div className='dashboard-home-page'>
      <h1 className="text-3xl font-bold mb-4">Hospital Management Dashboard</h1>
      <p>Welcome to the dashboard! Navigate using the menu above.</p>
    </div>
  );
}

export default Dashboard;
